import logo from './images/logo.svg';
import menu from './images/icons8-menu.svg';
import { useState } from 'react';
import Links from './Links';

const Navbar = () => {
    const [showLink, setShowLink] = useState(false);
    return (
        <nav className='w-10/12 mx-auto py-10 flex justify-between'>
            <img 
            className='h-8'
            src={logo} 
            alt="logo"/>
            {showLink && <Links />}
            <div className='flex items-center bg-red-300 gap-44 text-xs'>
                <div className='flex'>
                    <p className='mx-4'>Features</p>
                    <p className='mx-4'>Pricing</p>
                    <p className='mx-4'>Resources</p>
                </div>
                <div className='flex'>
                    <p className='mr-4'>Login</p>
                    <button className=' bg-cYan px-8'>Sign Up</button>
                </div>
            </div>
            <img 
            className='h-8 md:hidden'
            src={menu} 
            onClick={() => setShowLink(!showLink)}
            alt="navbar"/>
        </nav>
    );
}

export default Navbar;
